import { ChangeEventHandler } from "react";

const handleInput = (event: ChangeEventHandler<HTMLInputElement>) => {
    console.log(event.target.value);
};
export const InputSearch = () => {
    return (
        <input type="number" placeholder="Enter ID" onChange={handleInput} />
    );
};
